import { useState } from 'react';
import Menu_66 from './components/Menu_66';
import items from './data';

const App_66 = () => {
  const [menuItems, setMenuItems] = useState(items);

  console.log('menuItems', menuItems);
  return (
    <section className="menu">
      {/* title */}
      <div className="title">
        <h2>our menu</h2>
        <div className="underline"></div>
      </div>
      {/* filter buttons */}
    <div className="btn-container">
      <button type="button" class="filter-btn" data-id="all">
        all
      </button>
      <button type="button" class="filter-btn" data-id="breakfast">
        breakfast
      </button>
      <button type="button" class="filter-btn" data-id="lunch"> 
       lunch
      </button>
      <button type="button" class="filter-btn" data-id="shakes"> 
       shakes
      </button>
      <button type="button" class="filter-btn" data-id="dinner"> 
       dinner
      </button>
    </div>
    {/* menu items */}
    <Menu_66 />
    </section>
  );
};

export default App_66;
